import { Chart, Axis, Tooltip, Polygon, Line, Point} from 'viser-react';
import * as React from 'react';
import * as $ from 'jquery';
const DataSet = require('@antv/data-set');


const data = [
  { year: '1991', value: 3 },
  { year: '1992', value: 4 },
  { year: '1993', value: 3.5 },
  { year: '1994', value: 5 },
  { year: '1995', value: 4.9 },
  { year: '1996', value: 6 },
  { year: '1997', value: 7 },
  { year: '1998', value: 9 },
  { year: '1999', value: 13 },
];

const scale = [{
  dataKey: 'value',
  min: 0,
  values: ['Alexander', 'Marie', 'Maximilian', 'Sophia', 'Lukas', 'Maria', 'Leon', 'Anna', 'Tim', 'Laura']
},{
  dataKey: 'year',
  min: 0,
  max: 1,
  values: ['Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday']
}];

 class Reactjs extends React.Component {

    render() {
        const scale = [
            {
                dataKey: 'value',
                min: 0,

            },
            {
                dataKey: 'name',
                min: 0,
                max: 1,
                values: ['Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday']
            }
        ];
        return (
            <Chart data={data} forceFit height={500} padding={[20, 80, 120, 85]} scale={scale}>
                <Axis/>
                <Tooltip />
                <Line position="name*value" />
                <Point position="name*value" shape="circle"/>



            </Chart>
        );
    }
}
export default Reactjs
